import React,{useEffect,useState} from 'react'
import DialogTitle from '@mui/material/DialogTitle';
import Dialog from '@mui/material/Dialog';
import {Button} from "@mui/material";
import {DialogActions, TextField} from "@mui/material";
const NewItem = (props) => {
    const [stateDialog,updateState]=useState(props.openDialog)
    useEffect(()=>{
        updateState(props.openDialog)
    },[])
    const handleClose = () => {
        updateState(false)
    };

    return(
        <Dialog width={250} onClose={handleClose} open={stateDialog}>
            <DialogTitle>New TodoList</DialogTitle>
            <TextField label="Item Title" placeholder="Item Name"></TextField>
            <TextField label="Item info" placeholder="Item Description"></TextField>
            <DialogActions>
                <Button onClick={()=>handleClose()}>Cancel</Button>
                <Button> Add </Button>
            </DialogActions>
        </Dialog>
    )
}
export default NewItem
